INSERT INTO `theme_libs` VALUES (1, '<!DOCTYPE html>\n<html lang=\"zh-CN\">\n\n<head>\n  <meta charset=\"UTF-8\">\n  <meta name=\"viewport\" content=\"width=device-width, initial-scale=1.0\">\n  <title>图片页面</title>\n  <style>\n    /* 设置body的样式，使背景图片覆盖整个页面 */\n    /* body,\n    html {\n      width: 100%;\n      margin: 0;\n      font-family: Arial, sans-serif;\n      display: flex;\n      justify-content: center;\n      align-items: center;\n      flex-direction: column;\n    } */\n\n    /* 使用背景图片并使其适应整个页面 */\n    .bg-image-ziji {\n      /* 背景图片路径，请替换为您的图片URL */\n      /* background-image: url(\"~@/assets/w1.png\"); */\n      background-image: url(\"https://s2.loli.net/2024/07/10/NbzH1ciMWjlJCRT.png\");\n\n\n      /* 设置背景图片覆盖整个页面 */\n      height: 100vh;\n      background-position: center;\n      background-repeat: no-repeat;\n      background-size: cover;\n      position: absolute;\n      top: 0;\n      left: 0;\n      width: 100vw;\n      z-index: -1;\n      /* 将背景图片置于按钮下方 */\n    }\n\n    /* 按钮容器样式 */\n    .button-container-ziji {\n      padding-top: 46vh;\n      height: 100vh;\n      display: flex;\n      width: 100%;\n      height: 430px !important;\n      flex-direction: column;\n      align-items: center;\n      z-index: 1;\n    }\n\n    .tutorial-section {\n      width: calc(100% - 60px);\n      color: #6b68d6;\n    }\n\n    /* 按钮样式 */\n    .rounded-button-xuyao {\n      border-radius: 30px;\n      /* 圆角 */\n      border: none;\n      /* 无边框 */\n      padding: 10px 20px;\n      /* 内边距 */\n      margin: 10px 0;\n      /* 上下边距 */\n      background-color: #ffffff;\n      /* 背景颜色 */\n      color: #000000;\n      /* 文字颜色 */\n      text-align: center;\n      text-decoration: none;\n      display: inline-block;\n      font-size: 16px;\n      cursor: pointer;\n      box-shadow: 0px 4px 8px rgba(0, 0, 0, 0.1);\n      /* 阴影效果 */\n      width: calc(100% - 40px);\n      /* 宽度减去左右边距 */\n      /* 最大宽度，根据需要调整 */\n      margin-left: 20px;\n      margin-right: 20px;\n      background-image: linear-gradient(to right, #5a66c7, #418cc6);\n      color: white;\n      /* 文字颜色设置为白色，以便在渐变背景下可见 */\n\n\n    }\n\n    /* 鼠标悬停时的按钮样式 */\n    .rounded-button-xuyao:hover {\n      background-image: linear-gradient(to right, #418cc6, #5a66c7);\n    }\n\n    .help-parent {\n      display: flex;\n      justify-content: center;\n      justify-items: center;\n      align-items: center;\n      margin-left: 30px;\n      margin-right: 30px;\n      margin-top: 10px;\n      width: calc(100% - 60px);\n\n    }\n\n    .line {\n      border-bottom-left-radius: 30px;\n      border-top-left-radius: 30px;\n      flex-grow: 1;\n      height: 2px;\n      margin-left: 10px;\n      margin-right: 10px;\n      background-image: linear-gradient(to right, #418cc6, #5a66c7);\n\n    }\n\n    .line2 {\n\n      border-bottom-right-radius: 30px;\n      border-top-right-radius: 30px;\n      flex-grow: 1;\n      height: 2px;\n      margin-left: 10px;\n      margin-right: 10px;\n      background-image: linear-gradient(to right, #5a66c7, #418cc6);\n\n    }\n\n    .hgradient-text {\n      /* font-size: 60px; */\n      font-weight: bold;\n      background: linear-gradient(to right, #418cc6, #5a66c7);\n      -webkit-background-clip: text;\n      color: transparent;\n    }\n\n    /* 按钮样式 */\n    .rounded-button1 {\n\n      border-radius: 30px;\n      /* 圆角 */\n      border: none;\n      /* 无边框 */\n      padding: 10px 20px;\n      /* 内边距 */\n      /* margin: 0 20px; */\n      /* 左右边距 */\n      background-color: #ffffff;\n      /* 背景颜色 */\n      color: #000000;\n      /* 文字颜色 */\n      text-align: center;\n      text-decoration: none;\n      display: flex;\n      flex-direction: column;\n      align-items: center;\n      font-size: 16px;\n      cursor: pointer;\n      /* box-shadow: 0px 4px 8px rgba(0, 0, 0, 0.1); */\n      /* 阴影效果 */\n    }\n\n    /* 鼠标悬停时的按钮样式 */\n    .rounded-button1:hover {\n      background-color: #f0f0f0;\n    }\n\n    .line-zw {\n      margin-top: 40px;\n    }\n\n    .txt-top {\n      margin-top: 10px;\n    }\n  </style>\n</head>\n\n<body>\n\n  <!-- 容器div，背景图片将应用于这个div -->\n  <div class=\"bg-image-ziji\"></div>\n\n  <!-- 按钮容器 -->\n  <div class=\"button-container-ziji\">\n    <div class=\"tutorial-section\">\n      <h2>欢迎使用网盘扫码系统</h2>\n      <p>有效期：karleTime 扫码次数：karleNum</p>\n    </div>\n    <button class=\"rounded-button-xuyao\" onclick=\"onKarleSaoMa()\">电脑端/平板我扫码登录</button>\n    <button class=\"rounded-button-xuyao\" onclick=\"onKarleImg()\"> 苹果/安卓上传二维码登录</button>\n    <div class=\"line-zw\"></div>\n    <div class=\"help-parent\">\n      <div class=\"line\"></div>\n      <div class=\"hgradient-text\">首次登录使用教程请看教程</div>\n      <div class=\"line2\"></div>\n    </div>\n    <div class=\"help-parent\">\n      <div class=\"rounded-button1\" onclick=\"onKarleHelp(0)\">\n        <img src=\"https://s2.loli.net/2024/07/10/5yUkBoDQMqEnemR.png\" />\n        <div class=\"hgradient-text txt-top\">手机扫码</div>\n      </div>\n      <div class=\"rounded-button1\" onclick=\"onKarleHelp(1)\">\n        <img src=\"https://s2.loli.net/2024/07/10/fNPrER48Xk26VYL.png\" />\n        <div class=\"hgradient-text txt-top\">电脑/平板</div>\n      </div>\n      <div class=\"rounded-button1\" onclick=\"onKarleHelp(2)\">\n        <img src=\"https://s2.loli.net/2024/07/10/rMywB2k43KIE1Up.png\" />\n        <div class=\"hgradient-text txt-top\">二维码上传</div>\n      </div>\n    </div>\n  </div>\n</body>\n\n</html>', 0, 0, 'def1', NULL, '蓝色');
INSERT INTO `theme_libs` VALUES (2, '<html>\n\n<head>\n  <meta charset=\"utf-8\">\n  <meta content=\"width=device-width, initial-scale=1.0, user-scalable=0, minimum-scale=1.0, maximum-scale=1.0\"\n    name=\"viewport\">\n  <meta content=\"yes\" name=\"apple-mobile-web-app-capable\">\n  <meta content=\"black\" name=\"apple-mobile-web-app-status-bar-style\">\n  <meta name=\"format-detection\" content=\"telephone=no\">\n  <meta http-equiv=\"X-UA-Compatible\" content=\"IE=edge,chrome=1\">\n  <!-- <link rel=\"stylesheet\" href=\"https://bdcdn.5810faka.vip/css/global.css\"> -->\n  <!-- <link rel=\"stylesheet\" href=\"https://bdcdn.5810faka.vip/css/style.css?0507\"> -->\n  <!-- <script type=\"text/javascript\" src=\"https://bdcdn.5810faka.vip/js/jquery-3.6.0.min.js\"></script> -->\n  <!-- <script type=\"text/javascript\" src=\"https://bdcdn.5810faka.vip/layer/layer.js\"></script> -->\n  <!-- <link rel=\"stylesheet\" href=\"https://bdcdn.5810faka.vip/layer/theme/default/layer.css?v=3.5.1\" id=\"layuicss-layer\"> -->\n  <!-- <script src=\"https://res.wx.qq.com/open/js/jweixin-1.6.0.js\"></script> -->\n  <!-- <link rel=\"stylesheet\" href=\"https://bdcdn.5810faka.vip/css/swiper.min.css\"> -->\n  <meta name=\"viewport\" content=\"width=device-width, initial-scale=1.0, maximum-scale=1.0, user-scalable=0;\">\n  <style>\n    /* 设置body的样式，使背景图片覆盖整个页面 */\n    body,\n    html {\n      height: 100%;\n      width: 100%;\n      margin: 0;\n      font-family: Arial, sans-serif;\n      display: flex;\n      justify-content: center;\n      align-items: center;\n      flex-direction: column;\n    }\n\n    /* 按钮样式 */\n    .rounded-button-xuyao {\n      border-radius: 30px;\n      /* 圆角 */\n      border: none;\n      /* 无边框 */\n      padding: 10px 20px;\n      /* 内边距 */\n      margin: 10px 0;\n      /* 上下边距 */\n      background-color: #ffffff;\n      /* 背景颜色 */\n      color: #000000;\n      /* 文字颜色 */\n      text-align: center;\n      text-decoration: none;\n      display: inline-block;\n      font-size: 16px;\n      cursor: pointer;\n      box-shadow: 0px 4px 8px rgba(0, 0, 0, 0.1);\n      /* 阴影效果 */\n      width: calc(100% - 40px);\n      /* 宽度减去左右边距 */\n      /* 最大宽度，根据需要调整 */\n      margin-left: 20px;\n      margin-right: 20px;\n      background-image: linear-gradient(to right, #5a66c7, #418cc6);\n      color: white;\n      /* 文字颜色设置为白色，以便在渐变背景下可见 */\n\n\n    }\n\n    /* 鼠标悬停时的按钮样式 */\n    .rounded-button-xuyao:hover {\n      background-image: linear-gradient(to right, #418cc6, #5a66c7);\n    }\n  </style>\n</head>\n\n<body>\n\n  <div class=\"wrap bg4\" style=\"    max-width: 400px;\">\n    <div class=\"box\">\n      <div class=\"title\">\n        <div class=\"open\">\n          <h2 class=\"tc f18 b pt20 pb40\"></h2>\n          <div class=\"img1 imgbox\">\n            <!-- <img src=\"/upload/20240423/a23459f570baace43ea65ab23e40b24d.jpg\" alt=\"\"> -->\n            <img src=\"https://bd.tutu5058.com/upload/20240423/a23459f570baace43ea65ab23e40b24d.jpg\" alt=\"\">\n          </div>\n        </div>\n      </div>\n      <canvas id=\"canvas\" class=\"canvas\" style=\"width:300px;height:300px;display:none;margin:0 auto;\"></canvas>\n      <div class=\"flex-center align-center pt50 pb20\">\n        <img src=\"https://bd.tutu5058.com/assets/images/icon2a.png\" alt=\"\">\n        <span class=\"b f16 ph10\" style=\"color: #5A6392;\">首次登录使用请先看教程</span>\n        <img src=\"https://bd.tutu5058.com/assets/images/icon2b.png\" alt=\"\">\n      </div>\n      <div class=\"flex-between align-center  f14 lh40 ph15 jcbox\">\n\n        <span onclick=\"onKarleHelp(0)\" class=\"hong ask \" data-id=\"103\">手机教程</span>\n\n        <span onclick=\"onKarleHelp(1)\" class=\"hong ask \" data-id=\"104\">电脑登陆教程</span>\n\n        <span onclick=\"onKarleHelp(2)\" class=\"hong ask \" data-id=\"105\">图片上传教程</span>\n\n      </div>\n      <div class=\"pt50 pl15 pr15\">\n        <span onclick=\"onKarleSaoMa()\" class=\"mb20 link4a  flex-center align-center\">\n          <!-- <img src=\"/assets/images/icon1.png\" width=\"22\" alt=\"\"> -->\n          <img src=\"https://bd.tutu5058.com/assets/images/icon1.png\" width=\"22\" alt=\"\">\n\n          <span class=\"pl10\">PC端/平板点我扫码登录</span>\n        </span>\n        <span onclick=\"onKarleImg()\" class=\"mb20 link4b uploadfile flex-center align-center\">\n          <!-- <input type=\"file\" id=\"file\" onchange=\"fileChange()\" class=\"file\"> -->\n          <!-- &nbsp;&nbsp;<img src=\"/assets/images/icon2.png\" width=\"22\" alt=\"\"> -->\n          &nbsp;&nbsp;<img src=\"https://bd.tutu5058.com/assets/images/icon2.png\" width=\"22\" alt=\"\">\n\n          <span class=\"pl10\">苹果/安卓上传二维码登录</span>\n        </span>\n\n        <div onclick=\"onKarleShouHou()\" class=\"open\" style=\"display:none;\">\n          <span class=\"mb20 link4a  flex-center align-center\" style=\"background:#b56dc4\">\n            <!-- <img src=\"/assets/images/dj.png\" width=\"25\" alt=\"\"> -->\n            <img src=\"https://bd.tutu5058.com/assets/images/dj.png\" width=\"25\" alt=\"\">\n            <span class=\"pl10\">百度网盘SVIP点我购买</span>\n          </span>\n        </div>\n        <p style=\"color: #ABC0CC;\" class=\"tc pt20 f13\">\n          有效期：karleTime 扫码次数：karleNum\n        </p>\n\n        <div class=\"mt20 expire tc\">\n\n        </div>\n      </div>\n\n\n    </div>\n  </div><!--wrap end-->\n\n  <div class=\"\" id=\"ask_103\" style=\"display: none\">\n    <p><a href=\"https://note.youdao.com/s/HuiA4BBm\" target=\"_blank\" rel=\"noopener\">手机登录教程</a></p>\n  </div>\n\n  <div class=\"\" id=\"ask_104\" style=\"display: none\">\n    <p><a href=\"https://note.youdao.com/s/HuiA4BBm\" target=\"_blank\" rel=\"noopener\">电脑登录教程</a></p>\n  </div>\n\n  <div class=\"\" id=\"ask_105\" style=\"display: none\">\n    <p><a href=\"https://note.youdao.com/s/HuiA4BBm\" target=\"_blank\" rel=\"noopener\">内容下载教程</a></p>\n    <p>&nbsp;</p>\n  </div>\n\n\n  <div class=\"\" id=\"notice\" style=\"display: none\">\n\n  </div>\n\n  <div class=\"tzbg show\"></div>\n  <div id=\"model_notice\" class=\"notice show\">\n    <div class=\"head\">商城公告</div>\n    <div class=\"model_notice\">\n\n    </div>\n    <div class=\"sbc\">我知道了</div>\n  </div>\n\n  <style>\n    /** 清除内外边距**/\n    body,\n    h1,\n    h2,\n    h3,\n    h4,\n    h5,\n    h6,\n    hr,\n    p,\n    blockquote,\n    div,\n    /* 结构元素 */\n    dl,\n    dt,\n    dd,\n    ul,\n    ol,\n    li,\n    /* 列表元素 */\n    form,\n    fieldset,\n    legend,\n    button,\n    input,\n    textarea,\n    option,\n    select,\n    /* 表单元素 */\n    pre,\n    /* 文本格式元素 */\n    tr,\n    td,\n    /* 表格元素 */\n    img {\n      margin: 0;\n      padding: 0;\n    }\n\n    /** 设置默认字体 **/\n    h1,\n    h2,\n    h3,\n    h4,\n    h5,\n    h6,\n    em {\n      font-size: 12px;\n      font-weight: normal\n    }\n\n    /** 重置列表元素 **/\n    ul,\n    ol {\n      list-style: none;\n    }\n\n    /** 重置图片元素 **/\n    img {\n      border: 0px;\n    }\n\n    /** 重置表格元素 **/\n    table {\n      border-collapse: collapse;\n      border-spacing: 0;\n    }\n\n    /**重置表格元素**/\n    button {\n      cursor: pointer;\n    }\n\n    button,\n    input {\n      vertical-align: middle;\n      outline: none\n    }\n\n    button,\n    select,\n    textarea {\n      -webkit-appearance: none;\n      appearance: none;\n      outline: none\n    }\n\n    span,\n    a,\n    b {\n      display: inline-block;\n      outline: none;\n    }\n\n    /*定义滚动条高宽及背景 高宽分别对应横竖滚动条的尺寸\n.xzzwboxm::-webkit-scrollbar {width: 8px;height: 8px;background-color: transparent;}\n/*定义滚动条轨道 内阴影+圆角\n.xzzwboxm::-webkit-scrollbar-track {-webkit-box-shadow: transparent;border-radius: 0;background-color: transparent;}\n/*定义滑块 内阴影+圆角\n.xzzwboxm::-webkit-scrollbar-thumb {border-radius: 8px;-webkit-box-shadow: inset 0 0 6px rgba(0, 0, 0, .3);background: rgba(0, 100, 178, 0.3);\n}\n.scroll::-webkit-scrollbar-track {-webkit-box-shadow: transparent;border-radius: 0;background-color:none;}\n.scroll::-webkit-scrollbar {height: 40px;width: 2px;}\n.scroll